INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' welcome to your new acquia drupal website  if you are new to drupal follow these steps to set up your web site in minutes  step 1 start at the beginning visit the administration section for a taskbased or modulebased overview of the options available to configure your website step 2 connect to the acquia network at any time you can activate an acquia network subscription to gain access to acquia s timely professional support automated services such as mollom spam blocking acquia library and documentation acquia offers subscription levels for every size web site from individual blogs to enterprisescale multisite deployments once you have your acquia network subscription keys enter them on the settings page  get started with a free trial today step 3 activate functionality turn on added functionality for your site blogs forums polls tags comments and more acquia drupal comes with important modules to power social publishing capabilities on your site hundreds of additional drupal 7x compatible modules are available on drupalorg in the drupal modules download section  which you can install through your modules page  step 4 start publishing content start creating content for your site depending on which modules you have activated you may see blogs forums polls and more as available content types some optional configuration tasks are shown below for more information please refer to the builtin help section  or the online drupal handbooks  choose a different design start by changing the colors of the default theme to change the fundamental look and feel of your website visit the appearance section and choose a theme from one of the many themes available outofthebox many additional drupal 7x compatible themes are available on drupalorg in the drupal themes download section  which you can install through your themes page  configure the front page the default front page is a listing of all content marked as promoted to front page you can manage your content from the content administration page  you can also designate for example an item of content you have created as the front page see the site information settings page to configure the default front page path you can also edit you site name and add a slogan to make the site your own  ', 0);
